script: |
  super -f text -I q9839.spq | sort > q9839.out

inputs:
  - name: q9839.spq
    data: |
      SELECT + + 84 AS col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT col2 * + col2 BETWEEN - col2 AND 13 + + col0 + - + ( + col0 );
  - name: tab1

outputs:
  - name: q9839.out
    data: |
      84
      84
      84
